import styled from 'styled-components'

export const CallendarGrid = styled.div`
            display: grid;
            grid-template-columns: repeat(7, 1fr);
            grid-template-rows: repeat(6, 1fr);
            grid-gap: 1px;
            background-color: #494848;
        `;
